import * as react from 'react'
import '../assets/styles/components/Navbar.css'
import logo from '../assets/images/logo.svg'

const Navbar = () => {
    return (
        <div className='Navbar'>
            <div>
                <img src={logo} alt='logo' />
            </div>
        </div>
    )
}

export default Navbar
